import React from "react";

function App() {
  return <MyCom />;
}
const arr = [1, 2, 3, 4, 5, 7, 8];
function MyCom() {
  return (
    <h1>
      hello world{" "}
      {arr.map(val => (
        <div>{val}</div>
      ))}
    </h1>
  );
}
export default App;
